import React from 'react'
import "./feature.css"

const Feature = ({name, title}) => {
  return (
    <>
    <div className='gpt3_section-features'>
      <div className='gpt3_features'><h1>{name}</h1></div>
    </div>
    <div className='gpt3_text'><p>{title}</p></div>
    </>
  )
}

export default Feature
